ntent_h3','CSS'),(1402,315,'skill_star_img','298'),(1403,315,'skill_content_text','cssはhtmlで書かれたプログラムの整形、デザインを行う言語です。htmlとcssを両方使用することで初めてウェブサイトらしい見た目のサイトを制作することができます。'),(1404,315,'portofolio_pc_img',''),(1405,315,'portofolio_pc_img_inner',''),(1406,315,'portofolio_sp_img',''),(1407,315,'portofolio_sp_img_inner',''),(1408,315,'skill_add_class','css'),(1409,316,'skill_content_h3','Javascript'),(1410,316,'skill_star_img','298'),(1411,316,'skill_content_text','javascriptはhtmlとcssで制作したウェブサイトに動きを加えるためのプログラム言語です。フェードインなどの簡単な動きから背景の複雑な動きまで当サイトでも様々な場面で利用しています。'),(1412,316,'portofolio_pc_img',''),(1413,316,'portofolio_pc_img_inner',''),(1414,316,'portofolio_sp_img',''),(1415,316,'portofolio_sp_img_inner',''),(1416,316,'skill_add_class','javascript'),(1417,317,'skill_content_h3','PHP'),(1418,317,'skill_star_img','297'),(1419,317,'skill_content_text','PHPは、ウェブサイトに外部のデータを取り込み、それを処理するために利用されるプログラミング言語です。この言語を使用することで、現在時刻の表示や顧客情報の管理、ブログ記事の管理など、さまざまな機能を持つウェブサイトを構築できます。さらに、PHPは膨大なデータを効率的に扱うことができるため、大規模なウェブサイトの開発にも適しています。'),(1420,317,'portofolio_pc_img',''),(1421,317,'portofolio_pc_img_inner',''),(1422,317,'portofolio_sp_img',''),(1423,317,'portofolio_sp_img_inner',''),(1424,317,'skill_add_class','php'),(1425,319,'skill_content_h3','Wordpress'),(1426,319,'skill_star_img','297'),(1427,319,'skill_content_text','WordPressは、世界で最も普及しているブログサイト管理ツールの一つです。通常、ウェブサイトを制作する際に必須ではありませんが、企業がニュースやコンテンツをリアルタイムで反映したい場合に、手軽に更新できるようになります。'),(1428,319,'portofolio_pc_img',''),(1429,319,'portofolio_pc_img_inner',''),(1430,319,'portofolio_sp_img',''),(1431,319,'portofolio_sp_img_inner',''),(1432,319,'skill_add_class','wordpress'),(1433,318,'skill_content_h3','MySQL'),(1434,318,'skill_star_img','297'),(1435,318,'skill_content_text','MySQLは、WordPressをはじめとした世界中のさまざまなサービスで利用されているデータベース管理システムです。このシステムを利用することで、ブログや顧客情報の管理はもちろん、任意のデータを作成・管理することが可能です。'),(1436,318,'portofolio_pc_img',''),(1437,318,'portofolio_pc_img_inner',''),(1438,318,'portofolio_sp_img',''),(1439,318,'portofolio_sp_img_inner',''),(1440,318,'skill_add_class','mysql'),(1441,321,'skill_content_h3','Photoshop'),(1442,321,'skill_star_img','296'),(1443,321,'skill_content_text','Photoshopは、画像の加工やデザインカンプからのコーディングなどで使用されるソフトウェアです。ウェブサイトに載せるための画像を最適化したり、ウェブサイト全体のデザインカンプを作成して、そのデザインを参考にしながらプログラムを組む際にも活用されています。'),(1444,321,'portofolio_pc_img',''),(1445,321,'portofolio_pc_img_inner',''),(1446,321,'portofolio_sp_img',''),(1447,321,'portofolio_sp_img_inner',''),(1448,321,'skill_add_class','photoshop'),(1449,325,'skill_content_h3','illustrator'),(1450,325,'skill_star_img','296'),(1451,325,'skill_content_text','Illustratorは、ウェブサイト制作においてロゴや文字、背景のイラストなどの制作に使用されるソフトウェアです。Photoshopと並び、当方の業界に限らず、幅広い業界で使用されています。'),(1452,325,'portofolio_pc_img',''),(1453,325,'portofolio_pc_img_inner',''),(1454,325,'portofolio_sp_img',''),(1455,325,'portofolio_sp_img_inner',''),(1456,325,'skill_add_class','illustrator'),(1457,327,'skill_content_h3','adobe XD'),(1458,327,'skill_star_img','296'),(1459,327,'skill_content_text','XDは、Photoshopと同様にデザインカンプからコーディングする際のデザイン参照に特化したソフトウェアです。その扱いやすさから、最近ではこのソフトでのデザインのやり取りが増えてきています。'),(1460,327,'portofolio_pc_img',''),(1461,327,'portofolio_pc_img_inner',''),(1462,327,'portofolio_sp_img',''),(1463,327,'portofolio_sp_img_inner',''),(1464,327,'skill_add_class','adobexd'),(1465,328,'skill_content_h3','Figma'),(1466,328,'skill_star_img','297'),(1467,328,'skill_content_text','XDは、Photoshopと同様にデザインカンプからコーディングする際のデザイン参照に特化したソフトウェアです。その扱いやすさから、最近ではこのソフトでのデザインやり取りが増えてきています。'),(1468,328,'portofolio_pc_img',''),(1469,328,'portofolio_pc_img_inner',''),(1470,328,'portofolio_sp_img',''),(1471,328,'portofolio_sp_img_inner',''),(1472,328,'skill_add_class','figma'),(1593,357,'portfolio_content_h3','ギャラリーサイト'),(1594,357,'portfolio_content_text','これを校正して架空のイベント情報をテーマにしたギャラリーサイトです。パララックス効果を使用したサイトデザインとjavascriptによる様々な動きを取り入れたサイトになっています。'),(1595,357,'portfolio_site_link','a:3:{s:3:\"url\";s:72:\"https://webyayasu.sakura.ne.jp/portfolio/coding-sample02/html/index.html\";s:4:\"text\";s:4:\"more\";s:6:\"target\";s:6:\"_blank\";}'),(1