 -->\n<p>現状、遊び半分、仕事半分で使用していますが。かなりの頻度でプログラミングの問題集を出力させてそれを解いたりすることばかりに使用しています。これがかなり良い感じの問題集を出力してくれて、なんだったら教本を買うよりお得な感じがします。わからない部分は質問すればきっちり帰ってきますし。最近だとjavascriptやliquid(shopifyの開発言語)などですがおそらくメジャーなjavaやcでも出力できると思うので、今学習中の方やスキルアップのために新しい教材を探している方には大変おすすめなツールだと思ってます。</p>\n<!-- /wp:paragraph -->','chatGTPとプログラミング','','publish','open','open','','chatgtp%e3%81%a8%e3%83%97%e3%83%ad%e3%82%b0%e3%83%a9%e3%83%9f%e3%83%b3%e3%82%b0%e8%a8%80%e8%aa%9e','','','2025-03-23 07:23:47','2025-03-22 22:23:47','',0,'https://webyayasu.sakura.ne.jp/home/?p=146',3,'post','',0),(147,1,'2023-08-24 21:04:01','2023-08-24 12:04:01','<!-- wp:paragraph -->\n<p>ずいぶん前から巷ではchatGTPというものはやっていますが皆さんは使用していますでしょうか。私はつい最近まであまり使用したことがなかったのですが、仕事でどうしてもわからない部分が出てきて、お試し半分で使ってみたところ。今ではなくてはならない存在になりかけています。というのもこれまでわからないことはすべてグーグルで検索して探すという動作をしていて、やはりそれだと時間もかかるし、特にプログラミング系に関してはソースコードが間違っていたりして、意外と労力がかかります、そこから引っ張ってきたソースコードを自分の組んでいるものに当てはめるということとなると、さらに時間がかかってしまいひどいと１日の大半を使ってしまいます。ところがchatGTPでは行いたい処理を書き込むだけで自動でプログラムを書いてくれたりします。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">惜しいコードを出しまくるchatGTP</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>簡単な入門書に出てくる比較的処理のコードであればすぐに出てくるのですが、少々複雑なものを要求するとかなりの頻度で修正が必要なったりします。それも割とすぐに解決で来たりするものが多かったりします。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>現状、遊び半分、仕事半分で使用していますが。かなりの頻度でプログラミングの問題集を出力させてそれを解いたりすることばかりに使用しています。これがかなり良い感じの問題集を出力してくれて、なんだったら教本を買うよりお得な感じがします。わからない部分は質問すればきっちり帰ってきますし。最近だとjavascriptやliquid(shopifyの開発言語)などですがおそらくメジャーなjavaやcでも出力できると思うので、今学習中の方やスキルアップのために新しい教材を探している方には大変おすすめなツールだと思ってます。</p>\n<!-- /wp:paragraph -->','chatGTPとプログラミング言語','','inherit','closed','closed','','146-revision-v1','','','2023-08-24 21:04:01','2023-08-24 12:04:01','',146,'https://webyayasu.sakura.ne.jp/home/?p=147',0,'revision','',0),(148,1,'2023-08-24 21:04:54','2023-08-24 12:04:54','<!-- wp:paragraph -->\n<p>ずいぶん前から巷ではchatGTPというものはやっていますが皆さんは使用していますでしょうか。私はつい最近まであまり使用したことがなかったのですが、仕事でどうしてもわからない部分が出てきて、お試し半分で使ってみたところ。今ではなくてはならない存在になりかけています。というのもこれまでわからないことはすべてグーグルで検索して探すという動作をしていて、やはりそれだと時間もかかるし、特にプログラミング系に関してはソースコードが間違っていたりして、意外と労力がかかります、そこから引っ張ってきたソースコードを自分の組んでいるものに当てはめるということとなると、さらに時間がかかってしまいひどいと１日の大半を使ってしまいます。ところがchatGTPでは行いたい処理を書き込むだけで自動でプログラムを書いてくれたりします。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">惜しいコードを出しまくるchatGTP</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>簡単な入門書に出てくる比較的処理のコードであればすぐに出てくるのですが、少々複雑なものを要求するとかなりの頻度で修正が必要なったりします。それも割とすぐに解決で来たりするものが多かったりします。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>現状、遊び半分、仕事半分で使用していますが。かなりの頻度でプログラミングの問題集を出力させてそれを解いたりすることばかりに使用しています。これがかなり良い感じの問題集を出力してくれて、なんだったら教本を買うよりお得な感じがします。わからない部分は質問すればきっちり帰ってきますし。最近だとjavascriptやliquid(shopifyの開発言語)などですがおそらくメジャーなjavaやcでも出力できると思うので、今学習中の方やスキルアップのために新しい教材を探している方には大変おすすめなツールだと思ってます。</p>\n<!-- /wp:paragraph -->','chatGTPとプログラミング','','inherit','closed','closed','','146-revision-v1','','','2023-08-24 21:04:54','2023-08-24 12:04:54','',146,'https://webyayasu.sakura.ne.jp/home/?p=148',0,'revision','',0),(166,1,'2023-10-01 06:54:18','2023-09-30 21:54:18','','achievements','','inherit','open','closed','','achievements','','','2023-10-01 06:54:18','2023-09-30 21:54:18','',0,'https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/10/achievements.jpg',0,'attachment','image/jpeg',0),(168,1,'2023-10-01 06:55:16','2023-09-30 21:55:16','','coding','','inherit','open','closed','','coding','','','2023-10-01 06:55:16','2023-09-30 21:55:16','',0,'https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/10/coding.png',0,'attachment','image/png',0),(169,1,'2023-10-01 06:55:16','2023-09-30 21:55:16','','setting','','inherit','open','closed','','setting','','','2023-10-01 06:55:16','2023-09-30 21:55:16','',0,'https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/10/setting.png',0,'attachment','image/png',0),(170,1,'2023-10-01 06:55:16','2023-09-30 21:55:16','','wordpress','','inherit','open','closed','','wordpress','','','2023-10-01 06:55:16','2023-09-30 21:55:16','',0,'