/11/wp-300x211.jpg 300w\" sizes=\"(max-width: 340px) 100vw, 340px\" />															\n			<h3><h2 data-elementor-setting-key=\"title\" data-pen-placeholder=\"ここに入力...\" style=\"font-family: Roboto, sans-serif;\">WP制作</h2></h3>		\n		<p>wordpressのカスタマイズや保守。コーディングしたデータを元にオリジナルテーマの作成も行っています。</p>		\n															<img width=\"340\" height=\"239\" src=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/maintenance.jpg\" alt=\"\" srcset=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/maintenance.jpg 340w, https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/maintenance-300x211.jpg 300w\" sizes=\"(max-width: 340px) 100vw, 340px\" />															\n			<h3>保守・運営</h3>		\n		<p>既存のサイトの保守・運営業務を行っています。サイトのデザイン変更に伴うソースコード改修や、ブログ記事の更新などを行っています。</p>		\n															<img width=\"643\" height=\"339\" src=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample.jpg\" alt=\"\" srcset=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample.jpg 643w, https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample-300x158.jpg 300w\" sizes=\"(max-width: 643px) 100vw, 643px\" />															\n			<h2>迅速な対応</h2>		\n		<p>当方では各種チャットツールを使用し連絡のやり取りを行うことが可能です。また、基本的にいただいた連絡には通知に気が付き次第すぐにご返信いたしますので迅速な対応が可能です。</p>		\n			<h2>細かい作業にも対応</h2>		\n		<p>ウェブサイトの制作等のまとまった工程以外にも画像やテキストの一部変更など細かな作業のみでもしっかり対応いたします。</p>		\n															<img width=\"643\" height=\"339\" src=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample.jpg\" alt=\"\" srcset=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample.jpg 643w, https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/content3-sample-300x158.jpg 300w\" sizes=\"(max-width: 643px) 100vw, 643px\" />															\n			<h2>NEWS</h2>		\n															<img width=\"340\" height=\"239\" src=\"https://webyayasu.sakura.ne.jp/home/wp-content/uploads/2023/11/wp.jpg\" alt=\"\" srcset=\"https://webyayasu.sakur