=\"https://ja.react.dev/learn\" data-type=\"link\" data-id=\"https://ja.react.dev/learn\">react.js公式ドキュメント</a>を軸に基礎の学習を行っているが、最初に頭を悩ませて来たのはpropという概念で簡単に言えば子のコンポーネントのオブジェクトを親コンポーネント側で利用できるようにするというものなのだが、基本的に親から子に対するオブジェクトのやり取りはできるが子から親に対してのコンポーネントのやり取りができない。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:create-block/my-custom-block {\"codeContent\":\"import React from \'react\';\\nimport ReactDOM from \'react-dom/client\';\\n\\n// ChildComponent\\nfunction ChildComponent(props) {\\n  return (\\n    \\u003cdiv\\u003e\\n          \\u003cp\\u003e{props.name}\\u003c/p\\u003e //子に対してnameという変数を受け取っている\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\n// ParentComponent\\nfunction ParentComponent() {\\n  const name = \\u0022John Doe\\u0022;\\n  return (\\n    \\u003cdiv\\u003e\\n          \\u003cChildComponent name={name} /\\u003e//子に対してnameという変数を渡している\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\nconst root = ReactDOM.createRoot(document.getElementById(\'root\'));\\nroot.render(\\n    \\u003cReact.StrictMode\\u003e\\n        \\u003cParentComponent /\\u003e\\n    \\u003c/React.StrictMode\\u003e\\n);\"} -->\n<pre class=\"wp-block-create-block-my-custom-block prettyprint\"><code>import React from \'react\';\nimport ReactDOM from \'react-dom/client\';\n\n// ChildComponent\nfunction ChildComponent(props) {\n  return (\n    &lt;div>\n          &lt;p>{props.name}&lt;/p> //子に対してnameという変数を受け取っている\n    &lt;/div>\n  );\n}\n\n// ParentComponent\nfunction ParentComponent() {\n  const name = \"John Doe\";\n  return (\n    &lt;div>\n          &lt;ChildComponent name={name} />//子に対してnameという変数を渡している\n    &lt;/div>\n  );\n}\n\nconst root = ReactDOM.createRoot(document.getElementById(\'root\'));\nroot.render(\n    &lt;React.StrictMode>\n        &lt;ParentComponent />\n    &lt;/React.StrictMode>\n);</code></pre>\n<!-- /wp:create-block/my-custom-block -->','react.jsの学習(prop編)','現在ワードプレスやウェブサイト構築で対応可能な領域を広げるためreact.jsの学習を進行している。現状java関連と同時進行で学習を進めており、複数の言語(しかも性','publish','open','open','','react-js%e3%81%ae%e5%ad%a6%e7%bf%92prop%e7%b7%a8','','','2025-03-23 13:38:57','2025-03-23 04:38:57','',0,'http://localhost/wordpress/?p=482',2,'post','',0),(483,1,'2025-03-23 12:47:57','2025-03-23 03:47:57','<!-- wp:paragraph -->\n<p>現在ワードプレスやウェブサイト構築で対応可能な領域を広げるためreact.jsの学習を進行している。現状java関連と同時進行で学習を進めており、複数の言語(しかも性質が全く対照的な言語)を同時に学習する難易度の高さに頭を悩ませている。さて現状reactに関しては特別な教材なしで<a href=\"https://ja.react.dev/learn\" data-type=\"link\" data-id=\"https://ja.react.dev/learn\">react.js公式ドキュメント</a>を軸に基礎の学習を行っているが、最初に頭を悩ませて来たのはpropという概念で簡単に言えば子のコンポーネントのオブジェクトを親コンポーネント側で利用できるようにするというものなのだが、基本的に親から子に対するオブジェクトのやり取りはできるが子から親に対してのコンポーネントのやり取りができない。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:create-block/my-custom-block {\"codeContent\":\"ChatGPT:\\n以下にReact.jsのpropsに関する簡単な問題を提示します。データのやり取りに関する基本的な理解を試す問題です。\\n\\n問題：\\n親コンポーネントParentComponentが子コンポーネントChildComponentに名前を渡し、ChildComponentはその名前を表示するというシンプルなアプリケーションを作成します。以下のコードを完成させなさい。\\n\\njsx\\nコピーする\\n編集する\\nimport React from \'react\';\\n\\n// ChildComponent\\nfunction ChildComponent(props) {\\n  return (\\n    \\u003cdiv\\u003e\\n      {/* propsを使って名前を表示 */}\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\n// ParentComponent\\nfunction ParentComponent() {\\n  const name = \\u0022John Doe\\u0022;\\n  return (\\n    \\u003cdiv\\u003e\\n      {/* ChildComponentにnameを渡す */}\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\nexport default ParentComponent;\"} -->\n<pre class=\"wp-block-create-block-my-custom-block prettyprint\"><code>ChatGPT:\n以下にReact.jsのpropsに関する簡単な問題を提示します。データのやり取りに関する基本的な理解を試す問題です。\n\n問題：\n親コンポーネントParentComponentが子コンポーネントChildComponentに名前を渡し、ChildComponentはその名前を表示するというシンプルなアプリケーションを作成します。以下のコードを完成させなさい。\n\njsx\nコピーする\n編集する\nimport React from \'react\';\n\n// ChildComponent\nfunction ChildComponent(props) {\n  return (\n    &lt;div>\n      {/* propsを使って名前を表示 */}\n    &lt;/div>\n  );\n}\n\n// ParentComponent\nfunction ParentComponent() {\n  const name = \"John Doe\";\n  return (\n    &lt;div>\n      {/* ChildComponentにnameを渡す */}\n    &lt;/div>\n  );\n}\n\nexport default ParentComponent;</code></pre>\n<!-- /wp:create-block/my-custom-block -->','react.jsの学習(prop編)','','inherit','closed','closed','','482-revision-v1','','','2025-03-23 12:47:57','2025-03-23 03:47:57','',482,'http://localhost/wordpress/?p=483',0,'revision','',0),(484,1,'2025-03-23 12:48:46','2025-03-23 03:48:46','<!-- wp:paragraph -->\n<p>現在ワードプレスやウェブサイト構築で対応可能な領域を広げるためreact.jsの学習を進行している。現状java関連と同時進行で学習を進めており、複数の言語(しかも性質が全く対照的な言語)を同時に学習する難易度の高さに頭を悩ませている。さて現状reactに関しては特別な教材なしで<a href=\"https://ja.react.dev/learn\" data-type=\"link\" data-id=\"https://ja.react.dev/learn\">react.js公式ドキュメント</a>を軸に基礎の学習を行っているが、最初に頭を悩ませて来たのはpropという概念で簡単に言えば子のコンポーネントのオブジェクトを親コンポーネント側で利用できるようにするというものなのだが、基本的に親から子に対するオブジェクトのやり取りはできるが子から親に対してのコンポーネントのやり取りができない。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:create-block/my-custom-block {\"codeContent\":\"import React from \'react\';\\n\\n// ChildComponent\\nfunction ChildComponent(props) {\\n  return (\\n    \\u003cdiv\\u003e\\n      {/* propsを使って名前を表示 */}\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\n// ParentComponent\\nfunction ParentComponent() {\\n  const name = \\u0022John Doe\\u0022;\\n  return (\\n    \\u003cdiv\\u003e\\n      {/* ChildComponentにnameを渡す */}\\n    \\u003c/div\\u003e\\n  );\\n}\\n\\nexport default ParentComponent;\"} -->\n<pre class=\"wp-block-create-block-my-custom-block prettyprint\"><code>import React from \'react\';\n\n// ChildComponent\nfunction ChildComponent(props) {\n  return (\n    &lt;div>\n      {/* propsを使って名前を表示 */}\n    &lt;/div>\n  );\n}\n\n// ParentComponent\nfunction ParentComponent() {\n  const name = \"John Doe\";\n  return (\n    &lt;div>\n      {/* ChildComponentにnameを渡す */}\n    &lt;/div>\n  );\n}\n\nexport default ParentComponent;</code></pre>\n<!-- /wp:create-block/my-custom-block -->','react.jsの学習(prop編)','','inherit','closed','closed','','482-revision-v1','','','2025-03-23 12:48:46','2025-03-23 03:48:46','',482,'http://localhost/wordpress/?p=484',0,'revision','',0),(486,1,'2025-03-23 13:29:09','2025-03-